  "description": {
    "nb": "Brukerbilder fra Kulturminnesøk er et datasett (i form av en fildump) som består av publikums egne bilder på kultur- og brukerminner i nettløsningen Kulturminnesøk. Kulturminnesøk er en formidlingstjeneste fra Riksantikvaren, og driftes av en redaksjon. Informasjonen om de fleste kulturminnene i Kulturminnesøk kommer fra kulturminnebasen Askeladden som forvaltes av Riksantikvaren, men du som bruker kan altså også bidra med dine egne bilder inn i løsningen, både bilder på kulturminnene fra databasen Askeladden og på de brukerregistrerte brukerminnene. Teknisk beskrivelseDatasettet er kodet som JSON-LD. For mer info, se https://json-ld.org/. Hvert bilde skal kunne kobles med et kulturminne i kulturminnesok.no. ID til kulturminnet finnes under «contentLocation» - «@id». Hvis «@id» er https://data.kulturminne.no/askeladden/lokalitet/85373, kan denne vises på kulturminnesok.no med URLen https://kulturminnesok.no/minne/?queryString\u003dhttps://data.kulturminne.no/askeladden/lokalitet/85373. "
  },
